--[[
AZURE MODDED/FIXED BY Actyrn#7104
MAKE SURE TO CHECK THE DISCORD FOR UPDATES EVERYDAY!!
discord.gg/wDngb2mv4H

Info:
	UpdateMousePos is for Da Hood and some games that copied Da Hoods aiming system like Dat Hood etc
	
	GetMousePos is only for Hood Customs I'm pretty sure, you can try in other games if you want
	
	MousePos is for Hood Modded, maybe some other Hood Modded copies or whatever, you can figure it out
	
------------------------------------------------------------------------
	
If it's too hard to put a slider on to a specific number, you can type in the number box next to it to put in the number, it can't have decimals or negative numbers though
Script will drop some fps, can't figure out how to fix

------------------------------------------------------------------------

List of stuff I fixed/added:

    Added Jump Offset to Camera Aimbot !!
    Fixed the fly sometimes not working on reset(I think)
    Added customs MousePos types for Target Aim
    Fixed Locking onto wrong people(mostly)
    Added Velocity Resolver(resolves all velocity aa but breaks pred)
    Added more antis and customizations
    Fixed Antilocks being buggy/laggy
    Removed "Force Reset" to replace with "Anti Stomp"
    Fixed the lock making you lock onto people while typing
    Removed "Random Hitpart" to replace with multiple hitpart choices(basically random hitpart but u can do custom random hitparts)
    Added FOV toggle, "Use FOV" means it'll only lock onto people in the radius, if you turn off its just closest plr to cursor and itll ignore FOV size
    Added "Self Dot" to reveal your velocity, helpful to see if your anti is on or where the anti goes to
    This list could go on for about a hundred lines, but those are the most important stuff I did to the script
--]]

